import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { apiService } from '../services/api';
import CourseCard from '../components/CourseCard';

const Home = () => {
  const [featuredCourses, setFeaturedCourses] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadFeaturedCourses();
  }, []);

  const loadFeaturedCourses = async () => {
    try {
      const courses = await apiService.getCourses();
      // Show first 3 courses as featured
      setFeaturedCourses(courses.slice(0, 3));
    } catch (error) {
      console.error('Error loading courses:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="home">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1 className="hero-title">
            Master AI & Machine Learning
          </h1>
          <p className="hero-subtitle">
            Join thousands of students transforming their careers with cutting-edge courses 
            in Artificial Intelligence, Generative AI, and Deep Learning from industry experts.
          </p>
          <div className="hero-actions">
            <Link to="/courses" className="hero-btn primary">
              Explore Courses
            </Link>
            <Link to="/register" className="hero-btn secondary">
              Start Learning Free
            </Link>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features">
        <div className="container">
          <h2 className="section-title">Why Choose EDU-ARENA?</h2>
          <div className="features-grid">
            <div className="feature-card">
              <div className="feature-icon">🎯</div>
              <h3>Expert Instructors</h3>
              <p>Learn from industry professionals and academic experts with real-world experience in AI and ML.</p>
            </div>
            <div className="feature-card">
              <div className="feature-icon">🚀</div>
              <h3>Hands-on Projects</h3>
              <p>Build practical skills with real projects and case studies from the AI industry.</p>
            </div>
            <div className="feature-card">
              <div className="feature-icon">⏰</div>
              <h3>Flexible Learning</h3>
              <p>Learn at your own pace with lifetime access to course materials and updates.</p>
            </div>
          </div>
        </div>
      </section>

      {/* Featured Courses Section */}
      <section className="courses">
        <div className="container">
          <h2 className="section-title">Featured Courses</h2>
          
          {loading ? (
            <div className="loading">Loading featured courses...</div>
          ) : (
            <>
              <div className="courses-grid">
                {featuredCourses.map(course => (
                  <CourseCard key={course.id} course={course} />
                ))}
              </div>
              
              {featuredCourses.length === 0 && (
                <div className="error">
                  <h3>No courses available</h3>
                  <p>Check back later for new courses</p>
                </div>
              )}

              <div style={{ textAlign: 'center', marginTop: '3rem' }}>
                <Link to="/courses" className="btn btn-primary" style={{ padding: '1rem 2rem' }}>
                  View All Courses
                </Link>
              </div>
            </>
          )}
        </div>
      </section>

      {/* Stats Section */}
      <section className="features" style={{ background: 'var(--dark-black)', color: 'var(--white)' }}>
        <div className="container">
          <div className="features-grid">
            <div className="feature-card" style={{ background: 'rgba(255,255,255,0.1)' }}>
              <h3 style={{ color: 'var(--secondary-yellow)', fontSize: '3rem' }}>10,000+</h3>
              <p>Students Enrolled</p>
            </div>
            <div className="feature-card" style={{ background: 'rgba(255,255,255,0.1)' }}>
              <h3 style={{ color: 'var(--secondary-yellow)', fontSize: '3rem' }}>50+</h3>
              <p>Expert Instructors</p>
            </div>
            <div className="feature-card" style={{ background: 'rgba(255,255,255,0.1)' }}>
              <h3 style={{ color: 'var(--secondary-yellow)', fontSize: '3rem' }}>98%</h3>
              <p>Completion Rate</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
